import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';
import { useParams } from 'react-router-dom';

const StudentProfile = () => {
  const { user } = useAuth();
  const { id } = useParams();
  const [studentData, setStudentData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStudentData = async () => {
      try {
        const studentId = id || user?.id;
        if (!studentId) {
          setError('No student ID available');
          setLoading(false);
          return;
        }

        const response = await axios.get(`http://localhost:8000/api/students/${studentId}`);
        setStudentData(response.data);
      } catch (err) {
        console.error('Error fetching student data:', err);
        setError('Failed to load student data');
      } finally {
        setLoading(false);
      }
    };

    fetchStudentData();
  }, [id, user]);

  if (loading) {
    return (
      <div className="container mx-auto p-6">
        <div className="text-center">Loading student profile...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto p-6">
        <div className="text-center text-red-600">{error}</div>
      </div>
    );
  }

  if (!studentData) {
    return (
      <div className="container mx-auto p-6">
        <div className="text-center">No student data found</div>
      </div>
    );
  }

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold mb-6">Student Profile</h1>

      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Personal Information</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700">Name</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.name || 'N/A'}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Email</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.email || 'N/A'}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Enrollment Year</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.enrollment_year || 'N/A'}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Major</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.major || 'N/A'}</p>
          </div>
        </div>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-md mt-6">
        <h2 className="text-xl font-semibold mb-4">Academic Performance</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700">Previous GPA</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.previous_gpa || 'N/A'}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Attendance Percentage</label>
            <p className="mt-1 text-sm text-gray-900">{studentData.attendance_percentage ? `${studentData.attendance_percentage}%` : 'N/A'}</p>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Risk Level</label>
            <p className={`mt-1 text-sm font-semibold ${studentData.risk_level === 'high' ? 'text-red-600' : studentData.risk_level === 'medium' ? 'text-yellow-600' : 'text-green-600'}`}>
              {studentData.risk_level || 'N/A'}
            </p>
          </div>
        </div>
      </div>

      {studentData.academic_details && studentData.academic_details.length > 0 && (
        <div className="bg-white p-6 rounded-lg shadow-md mt-6">
          <h2 className="text-xl font-semibold mb-4">Academic Details</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full table-auto">
              <thead>
                <tr className="bg-gray-50">
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Semester</th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">GPA</th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Courses</th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Attendance</th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {studentData.academic_details.map((detail, index) => (
                  <tr key={index}>
                    <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-900">{detail.semester}</td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-900">{detail.gpa}</td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-900">{detail.courses_completed}</td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-900">{detail.attendance_rate}%</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default StudentProfile;
